import React from "react";
import styled from "styled-components";

const SemesterBlock = ({ text }) => {
  return (
    <SemesterDiv>
      <SemesterTop>{text.number}</SemesterTop>
      <SemesterBottom>
        <SemesterCheck>
          <i class="fa-solid fa-check"></i>
        </SemesterCheck>
        <SemesterCourses>
          <li>{text.course1}</li>
          <li>{text.course2}</li>
          <li>{text.course3}</li>
          <li>{text.course4}</li>
          <li>{text.course5}</li>
          <li>{text.course6}</li>
          <li>{text.course7}</li>
          <li>{text.course8}</li>
        </SemesterCourses>
      </SemesterBottom>
    </SemesterDiv>
  );
};

export default SemesterBlock;

const SemesterDiv = styled.div``;
const SemesterTop = styled.div``;
const SemesterBottom = styled.div``;
const SemesterCheck = styled.div`
  color: #ff6262;
`;
const SemesterCourses = styled.ul`
  display: flex;
  flex-direction: column;
  list-style: none;
`;
